{{`<div id="qrcode${currentItem.channel.channel_id}"></div>
<script src="
https://cdn.jsdelivr.net/npm/qrcodejs-bd@1.0.2/qrcode.min.js
"></script>
<script>
var qrcode = new QRCode(document.getElementById("qrcode${currentItem.channel.channel_id}"), {
        text: '!MRTMP="${currentItem.channel.rtmp_server}"',
        colorDark : "#000000",
        colorLight : "#ffffff",
        correctLevel : QRCode.CorrectLevel.M,
				width: 360,
				height: 360,
				border: 2
    });
		var code = document.getElementById("qrcode${currentItem.channel.channel_id}");

code.style.cursor = 'pointer';
code.onclick = function() {
const dataUrl = code.querySelector('img').src;
		var link = document.createElement("a");
		link.download = "qrcode_ ${currentItem.stream_name}.png";
		link.href = dataUrl;
		document.body.appendChild(link);
		link.click();
		document.body.removeChild(link);
}

		</script>`}}

